function fun(){
  let str="Reverse Words in a String Reverse Words in".split(' ');
  let hash={};

  for(let i=0; i<str.length; i++){
    if(hash[str[i]]){
      hash[str[i]]++;
    }else{
      hash[str[i]]=1
    }
