const non_repeating_character = `
function unique(){
  let str="Java is great Grails is also great Grails is also great";
  let newStr = str.split(' ');
  const result = [];

  for(let i=0; i<newStr.length; i++){
    if(!result.includes(newStr[i])){
      result.push(newStr[i])
    }
