  console.log(result);
}

unique();
`.trim();

const findVowel = `
function fun(){
  const str='apple';
  const vowel='aeiou';
  let result='';

  for(let i=0;i<str.length;i++){
    if(vowel.includes(str.charAt(i))){
      result += str.charAt(i)
    }
  }
  console.log(result)
}

fun()`.trim();

const isIsomorphic = `
function fun() {
  const str1 = 'egg';
  const str2 = 'add';

  for (let i = 0; i < str1.length; i++) {
    const a = str1.indexOf(str1[i]);
    const b = str2.indexOf(str2[i]);
    if (str2[a] !== str2[b] || str1[b] !== str1[a]) {
      return false;
    }
  }

  return true;
}


console.log(fun());
`.trim();

const wordBreak = `
function fun() {
  let str="leetcode"
  let wordDict = ["leet", "code"];
  let result=[]

  for (let i = 1; i <= str.length; i++) {
    for (let j = 0; j < i; j++) {
      if (wordDict.includes(str.substring(j, i))) {
        result.push(str.substring(j, i))
        break;
      }
    }
  }

  return console.log(result);
}

fun()
`.trim();

const removeDuplicates = `
function removeDup() {
  const str = "wwelcom";
  let stack = [];
  for (let i = 0; i < str.length; i++) {
    if (str[i] === stack[stack.length - 1]) {
      stack.pop();
    } else {
      stack.push(str[i]);
    }
  }
  return console.log(stack.join(""));
}

removeDup();
`.trim();

const lonStr = `
function lonStr(){
  const str = 'second item is longer than the third one';
  const arr=str.split(' ');

  let lgth = 0;
